import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	contact: {
		paddingTop: "8rem",
		textAlign: "center",
	},
	packages: {
		display: "flex",
		justifyContent: "center",
		margin: "3rem 0",
	},
	paper: {
		margin: "0 10px",
		padding: "10px 0",
	},
}));
